  return (
    <Group13311>
      <SeeOtherParking>See Other Parking</SeeOtherParking>
    </Group13311>
  );
}

const Group13311 = styled.div`
  position: absolute;
  height: 46px;
  top: 1779px;
  left: 290px;
  display: flex;
  padding: 13.1px 37.4px;
  justify-content: flex-end;
  align-items: flex-end;
  min-width: 203px;
  background-image: url(/img/group-50-1@1x.png);
  background-size: cover;
  background-position: 50% 50%;
`;

const SeeOtherParking = styled.div`
  ${PetalaproNormalWhite15px}
  min-height: 19px;
  min-width: 126px;
  letter-spacing: 0;
  line-height: 18px;
  white-space: nowrap;
`;

const Group13312 = styled.div`
  position: absolute;
  height: 46px;
  top: 1779px;
  left: 290px;
  display: flex;
  padding: 13.1px 37.4px;
  justify-content: flex-end;
  align-items: flex-end;
  min-width: 203px;
  background-image: url(/img/group-50-1@1x.png);
  background-size: cover;
  background-position: 50% 50%;
`;

const SeeOtherParking1 = styled.div`
  ${PetalaproNormalWhite15px}
  min-height: 19px;
  min-width: 126px;
  letter-spacing: 0;
  line-height: 18px;
  white-space: nowrap;
`;

export default Group1331;
